root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);


class Square extends React.Component {
	render() {
		return (
		<div>
			{this.props.value}
		</div>
	)
	}
}


class Board extends React.Component {
	render() {
		return (
